import styled from 'styled-components'
import back from '../../assets/imgHead.jpg'

export const Container = styled.div`
  width: 100%;
  width: 2000px;
  height: 2000px;
  flex: 1 1 100%;
  padding: 45px 8px;
  display: flex;
  flex-direction: column;
  height: 100vh;
  position: relative;
  background-size: contain;
  background: url(${back});
`
